const ProdutosSaecomp = (props:any) =>{

    return(
        <VendasDiv>
            <CardVendas
            url = "img1">
            </CardVendas>
            <CardVendas
            url = "img2">
            </CardVendas>
            <CardVendas
            url = "img3">
            </CardVendas>
            <CardVendas
            url = "img4">
            </CardVendas>
            <CardVendas
            url = "img5"> 
            </CardVendas>
        </VendasDiv>
        
    );
}

export default ProdutosSaecomp;
